  false,\n\t\"url\": null,\n\t\"notes\": \"These data are a derived product of the
  NOAA VDatum tool and they extend the tool's Mean Higher High Water (MHHW) tidal
  datum conversion inland beyond its original extent. VDatum was designed to vertically
  transform geospatial data among a variety of tidal, orthometric and ellipsoidal
  vertical datums - allowing users to convert their data from different horizontal/vertical
  references into a common system and enabling the fusion of diverse geospatial data
  in desired reference levels (http://vdatum.noaa.gov/). However, VDatum's conversion
  extent does not completely cover tidally-influenced areas along the coast. For more
  information on why VDatum does not provide tidal datums inland, see http://vdatum.noaa.gov/docs/faqs.html.
  Because of the extent limitation and since most inundation mapping activities use
  a tidal datum as the reference zero (i.e., 1 meter of sea level rise on top of Mean
  Higher High Water), the NOAA Office for Coastal Management created this dataset
  for the purpose of extending the MHHW tidal datum beyond the areas covered by VDatum.
  The data do not replace VDatum, nor do they supersede the valid datum transformations
  VDatum provides. However, the data are based on VDatum's underlying transformation
  data and do provide an approximation of MHHW where VDatum does not provide one.
  In addition, the data are in a GIS-friendly format and represent MHHW in NAVD88,
  which is the vertical datum by which most topographic data are referenced. Data
  are in the UTM NAD83 projection. Horizontal resolution varies by VDatum region,
  but is either 50m or 100m. Data are vertically referenced to NAVD88 meters.\",\n\t\"owner_org\":
